(14315, 'Chateau olivier', '', '', 'Grand Cru Classe Pessac Leognan', 'grand-cru-classe-pessac-leognan', 'Boissons,Boissons alcoolisées,Vins,Vins français,Vins rouges,Bordeaux,Vins blancs,Pessac-Léognan', '', 'France', 'Château Olivier GRAND CRU CLASSÉ DE GRAVES PESSAC-LÉOGNAN APPELLATION PÉSSAC-LÉOGNAN CONTRÔLÉE Château Olivier est un des plus anciens Châteaux du Bordelais. La Seigneurie d\'Olivier remonte au XIIeme siècle l\'on retrouve dès cette époque les origines du château authentique et plein de charme situé aux portes de Bordealll Ce Cru Classé se distingue par la qualité exceptionnelle de ses vins où l\'élégance, l\'équilibre et la finesse dominent année après année, caractéristiques des plus grands vins de Bordeaut Château Olivier is one of the Oldest wine châteaux in the Bordeaux region. The Olivier seigneury dates back to the 12th century, and the origins of this authentic and enchanting château, located just ouside the gates of Bordeaux city, can be traced back to this period. This classified growth is reputed for wines of outstanding quality, in which elegance, balance and finesse, the hallmark characteristics of the greatest Bordeau! wines, come to the fore in every vintage. Château Olivier sarl - Jean-Jacques de Bethmann Léognan - 33850 - Gironde - France mail@chateau-olivier.com - www.chateau-olivier.c0m MIS EN BOUTEILLE AU CHÂTEAU Produit de France', '', '', '0', '', '', 'A compléter,Informations nutritionnelles complétées,Ingrédients complétés,Date limite à compléter,en:Packaging-code-to-be-completed,Caractéristiques à compléter,Catégories complétées,Marques complétées,Emballage à compléter,Quantité à compléter,Nom du produit complete,Photos à valider,Photos envoyées', 'Boissons', '', '', '42', '', '1', '1', '', '1', '1', '', '', '', '', '', '', '0', '0', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
