(14332, 'Poulet thai', '', '', 'New Covent Garden Soup Co', 'new-covent-garden-soup-co', '', '', 'France', 'Eau, maïs doux (12%), crème de noix de coco, poulet (5%) oignon, bouillon de poulet déshydraté, farine de blé, basilic, menthe, gingembre, ail, piments jalapeno, jus de citron, jus de citron vert, sel, poivre noir. Bouillon de poulet déshydraté contient: extrait de levure, sel, farine de blé, poulet, oignons, carottes, sucre, levure, poivre noir, sauge, extrait de romarin. Farine de blé contient: farine de blé, carbonate de calcium, fer, thiamine, nicotinamide. Bien que toutes les précautions aient été prises pour enlever tous les os, il pourrait en rester quelques uns. Allergènes Voir les ingrédients en gras et surlignés.', '', '', '3', 'E170 - Carbonate de calcium,E375 - Acide nicotinique,E392 - Extrait de romarin', 'b', 'A compléter,Informations nutritionnelles complétées,Ingrédients complétés,Date limite à compléter,en:Packaging-code-to-be-completed,Caractéristiques à compléter,Catégories à compléter,Marques complétées,Emballage à compléter,Quantité à compléter,Nom du produit complete,Photos à valider,Photos envoyées', '', '', '', '188', '', '2.4', '2', '', '3.3', '1.7', '', '', '', '', '', '1.6', '1.7', '0.53', '0.208661417322835', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '0'),
