(14335, 'Angelina', '', '', 'Pedone', 'pedone', '', '', 'France', 'pâte et crème de marron 34% (marron, sucre, vanille), crème (lait), sucre, eau, jaune d\'?uf, morceaux de marrons glacés 5,7 % (marrons, sucre, vanille), meringues 1,8% (sucre, amidon de blé, blanc d\'oeuf, arôme), émulsifiant : mono et di-glycérides d\'acides gras (issus d\'huiles végétales), épaississants : farine de graine de guar, caroube, carraghénanes (extrait d\'algues). Allergènes : contient des ingrédients à base de lait, oeufs et gluten. Peut contenir des traces de soja, fruits à coque, sésame. Conseils de dégustation : laisser 5 minutes à température ambiante avant dégustation. Après décongélation : ne pas recongeler. Conservation à -180C. Valeurs nutritionnelles moyennes pour 100 g : Energie 1146 kJ/273 kcal - Matières grasses : 12g - dont acides gras saturés : 7g - Glucides : 39,3g - dont sucres : 31g - Protéines : 2g - Sel : 0,05g. A consommer de préférence avant fin : voir sur le côté de la boîte.', '', '', '3', 'E407 - Carraghénanes,E412 - Gomme de guar,E471 - Mono- et diglycérides d\'acides gras alimentaires', 'd', 'A compléter,Informations nutritionnelles complétées,Ingrédients à compléter,Date limite à compléter,en:Packaging-code-to-be-completed,Caractéristiques à compléter,Catégories à compléter,Marques complétées,Emballage à compléter,Quantité à compléter,Nom du produit complete,Photos à valider,Photos envoyées', '', '', '', '1142', '', '12', '7', '', '39.3', '31', '', '', '', '', '', '', '2', '0.05', '0.0196850393700787', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '15'),
